	@Inject
	public HouseBuilderGrammarAccess(GrammarProvider grammarProvider,
			TerminalsGrammarAccess gaTerminals) {
		this.grammar = internalFindGrammar(grammarProvider);
		this.gaTerminals = gaTerminals;
		this.pHouse = new HouseElements();
		this.pSpace = new SpaceElements();
		this.pEString = new EStringElements();
		this.pEDate = new EDateElements();
		this.pFloor = new FloorElements();
		this.pPassage = new PassageElements();
		this.pController = new ControllerElements();
		this.pEntrance = new EntranceElements();
		this.pEInt = new EIntElements();
		this.pEFloat = new EFloatElements();
		this.pDevice = new DeviceElements();
		this.pSensor = new SensorElements();
		this.pRoom = new RoomElements();
		this.pExternalSpace = new ExternalSpaceElements();
		this.eDeviceType = new DeviceTypeElements();
		this.pActuator = new ActuatorElements();
		this.eActuatorType = new ActuatorTypeElements();
		this.eSensorType = new SensorTypeElements();
		this.eRoomType = new RoomTypeElements();
		this.pWindow = new WindowElements();
		this.eExternalSpaceType = new ExternalSpaceTypeElements();
		this.eGroundType = new GroundTypeElements();
		this.eDoorType = new DoorTypeElements();
	}
	
	protected Grammar internalFindGrammar(GrammarProvider grammarProvider) {
		Grammar grammar = grammarProvider.getGrammar(this);
		while (grammar != null) {
			if ("it.univaq.disim.housebuilder.xtext.HouseBuilder".equals(grammar.getName())) {
				return grammar;
			}
			List<Grammar> grammars = grammar.getUsedGrammars();
			if (!grammars.isEmpty()) {
				grammar = grammars.iterator().next();
			} else {
				return null;
			}
		}
		return grammar;
	}
	
	@Override
	public Grammar getGrammar() {
		return grammar;
	}
	
	
	public TerminalsGrammarAccess getTerminalsGrammarAccess() {
		return gaTerminals;
	}

	
